    //                     </div>
    //                     <div className="carousel-inner">
    //                         <div className="carousel-item active">
    //                             <img src="Images/CarouselImg3.png" className="d-block" width='1712px' height='600px' alt="..." />
    //                             <div class="carousel-caption d-none d-md-block text-dark bg-white rounded-pill">
    //                                 <h5>Automated Data Entry:</h5>
    //                                 <p>Eliminate manual data entry with bank integrations and automatic categorization.</p>
    //                             </div>
    //                         </div>
    //                         <div className="carousel-item">
    //                             <img src="Images/CarouselImg2.png" className="d-block" width='1712px' height='600px' alt="..." />
    //                             <div class="carousel-caption d-none d-md-block text-dark bg-white rounded-pill">
    //                                 <h5>Real-time Financial Reports:</h5>
    //                                 <p>Track your cash flow, income, and expenses in real-time.</p>
    //                             </div>
    //                         </div>
    //                         <div className="carousel-item">
    //                             <img src="Images/CarouselImg1.png" className="d-block" width='1712px' height='600px' alt="..." />
    //                             <div class="carousel-caption d-none d-md-block text-dark bg-white rounded-pill">
    //                                 <h5>Simplified Invoicing:</h5>
    //                                 <p>Create and send professional invoices with ease.</p>
    //                             </div>
    //                         </div>
    //                     </div>
    //                     <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="prev">
    //                         <span className="carousel-control-prev-icon" aria-hidden="true"></span>
    //                         <span className="visually-hidden">Previous</span>
    //                     </button>
    //                     <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="next">
    //                         <span className="carousel-control-next-icon" aria-hidden="true"></span>
    //                         <span className="visually-hidden">Next</span>
    //                     </button>
    //                 </div>
    //             </div>
    //         </div>
    //     </div>
    // </>);

    return (<div className="home">
        <header>
            <h1>Effortless Accounting for Your Business</h1>
            <p>Manage finances, streamline processes, and gain insights - all in one place.</p>
            <img src="hero-image.jpg" alt="Finsync Interface" className="hero-image" />
            <a href="#" className="btn">Start Free Trial</a>
        </header>

        <section className="features">
            <h2>Key Features</h2>
            <div className="feature-cards">
                <FeatureCard
                    icon="fas fa-sync"
                    title="Automated Data Entry"
                    description="Eliminate manual data entry with bank integrations and automatic categorization."
                />
                <FeatureCard
                    icon="fas fa-file-invoice"
                    title="Simplified Invoicing"
                    description="Create and send professional invoices with ease."
                />
                <FeatureCard
                    icon="fas fa-chart-line"
                    title="Real-time Financial Reports"
                    description="Track your cash flow, income, and expenses in real-time."
                />
                <FeatureCard
                    icon="fas fa-calculator"
                    title="Effortless Tax Preparation"
                    description="Simplify tax filing with organized financial data."
                />
            </div>
        </section>

        <section className="benefits">
            <h2>Why Choose Finsync?</h2>
            <ul>
                <li>Save Time & Money: Reduce manual work and focus on growing your business.</li>
                <li>Gain Control: Get a clear view of your finances with comprehensive dashboards and reports.</li>
                <li>Make Smarter Decisions: Data-driven insights to guide your business strategy.</li>
                <li>Peace of Mind: Securely store and access your financial data anytime, anywhere.</li>
            </ul>
        </section>

        <section className="social-proof">
            <h2>Trusted by Businesses</h2>
            <p>"Finsync has revolutionized the way we manage our finances. It's easy to use, saves us time, and gives us valuable insights." - John Doe, CEO of Acme Inc.</p>
            <div className="logos">
                <img src="logo1.png" alt="Company Logo 1" />
                <img src="logo2.png" alt="Company Logo 2" />
                <img src="logo3.png" alt="Company Logo 3" />
            </div>
            <div className="stats">
                <p><strong>X%</strong> Time Saved</p>
                <p><strong>Y</strong> Happy Customers</p>
            </div>
        </section>

        <section className="cta">
            <h2>Take Control of Your Finances Today!</h2>
            <a href="#" className="btn">Get Started Now</a>
        </section>

        <footer>
            <p>&copy; Finsync 2024</p>
        </footer>
    </div>);
}
export default HomePage;
